import './App.css';
import Header from './Header.js'
import Navbar from './Navbar';

function App() {
  const name = 'kingsley';

  return (
    <div className="App">
      <Header /> 
      <Navbar />

      <p>My name is {name}, i'm a developer</p>
    </div>
  );
}

export default App;
